import { ADD_DRIVER , ADD_DRIVER_SUCCESSFUL, ADD_DRIVER_FAILED, FETCH_DRIVER, FETCH_DRIVER_SUCCESSFUL , FETCH_DRIVER_FAILED} from './actionTypes';


export const addDriver = (name, email, address, phone, history) => {
    console.log(name);
    return {
        type: ADD_DRIVER,
        payload: { name, email, address, phone, history }
    }
}

export const addDriverSuccessful = () => {
    return {
        type: ADD_DRIVER_SUCCESSFUL
    }
}

export const addDriverFailed= () => {
    return {
        type: ADD_DRIVER_FAILED
    }
}

export const fetchDriver= () => {
    return {
        type: FETCH_DRIVER
    }
}

export const fetchDriverSuccessful = (data) => {
    console.log(data);
    return {
        type: FETCH_DRIVER_SUCCESSFUL,
        data: data
    }
}

export const fetchDriverFailed= (error) => {
    console.log(error);
    return {
        type: FETCH_DRIVER_FAILED
    }
}
